import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      title: 'Joseph Wolff',
      headerLinks: [
        { title: 'Home', path: '/' },
        { title: 'About', path: '/about' },
        { title: 'Blog', path: '/blog' },
        { title: 'Contact', path: '/contact' }
      ],
      home: {
        title: 'Full Stack Web Developer',
        subTitle: 'Projects that inspire',
        selfDescription: 'Projects that convey limitless potential and an undying desire to learn new skills'
      },
      about: {
        title: 'About me',
        subTitles: [
          'Who am I?',
          'What do I do?',
          'How do I do it?',
          'What am I passionate about?'
        ],
        descriptions: [
          'Description of who I am professionally',
          'Description of what I do as a developer',
          'Description of how I do my work (technologies, organizational skills, etc.)',
          'Descriptions of professional passions for self development (Building web apps, Apps centered around nature, Ai, Ml, etc.)'
        ]
      },
      cotact: {
        title: "Let's connect:",
        userFullName: '',
        userEmailAddress: '',
        userMessage: ''
      }
    }
  }

  render() {
    return (
      <Router>
        <Container className="p-0" fluid={true}>

          <Navbar>
            <Navbar.Brand>Joseph Wolff</Navbar.Brand>
          </Navbar>

        </Container>
      </Router>
    );
  }
}

export default App;
